import React from "react";

const Project = () => {
  return (
    <div class="project-container">
      <a href="https://joshua-watson96.github.io/Travel-Wise/">
        <img src="./assets/TravelWise.png" alt="travel wise app" />
        <p> Travel Wise </p>
      </a>
    </div>
  );
};

export default Project;
